\naircraft is trading airspeed for altitude and when the climb is established. \n&lt;/p&gt;\n\n&lt;h2&gt;Performance discrepancy&lt;/h2&gt;\n\n&lt;table&gt;\n  &lt;tr&gt;\n    &lt;th&gt;Density Altityde (ft)&lt;/th&gt;\n    &lt;th&gt;Measured (ft)&lt;/th&gt;\n    &lt;th&gt;POH (ft)&lt;/th&gt;\n    &lt;th&gt;discrepancy (%)&lt;/th&gt;\n  &lt;/tr&gt;\n  &lt;tr&gt;\n    &lt;td&gt;0&lt;/td&gt;\n    &lt;td&gt;478&lt;/td&gt;\n    &lt;td&gt;657&lt;/td&gt;\n    &lt;td&gt;-27.25&lt;/td&gt;\n  &lt;/tr&gt;\n  &lt;tr&gt;\n    &lt;td&gt;2000&lt;/td&gt;\n    &lt;td&gt;336&lt;/td&gt;\n    &lt;td&gt;554&lt;/td&gt;\n    &lt;td&gt;-39.35&lt;/td&gt;\n  &lt;/tr&gt;\n  &lt;tr&gt;\n    &lt;td&gt;4000&lt;/td&gt;\n    &lt;td&gt;421&lt;/td&gt;\n    &lt;td&gt;449&lt;/td&gt;\n    &lt;td&gt;-6.24&lt;/td&gt;\n  &lt;/tr&gt;\n  &lt;tr&gt;\n    &lt;td&gt;6000&lt;/td&gt;\n    &lt;td&gt;297&lt;/td&gt;\n    &lt;td&gt;347&lt;/td&gt;\n    &lt;td&gt;-14.41&lt;/td&gt;\n  &lt;/tr&gt;\n  &lt;tr&gt;\n    &lt;td&gt;8000&lt;/td&gt;\n    &lt;td&gt;238&lt;/td&gt;\n    &lt;td&gt;255&lt;/td&gt;\n    &lt;td&gt;-6.67&lt;/td&gt;\n  &lt;/tr&gt;\n&lt;/table&gt;\n\n&lt;h2&gt;Conclusion&lt;/h2&gt;\n\n&lt;p&gt;\nThe discrepency in climb performance seems to be more prononced at lower altitude. \n&lt;/p&gt;\n\n&lt;p&gt;\nThe higher discrepency at 2000ft is probably to a combination of incorrect IAS (close to 75k) and incorrect\npower setting. \n&lt;/p&gt;\n\n&lt;p&gt;\nOverall the decrease in climb performance is probably an average around 10%.\n&lt;/p&gt;\n\n\n"},"id":"1180","type":"Div"},{"attributes":{},"id":"1034","type":"AllLabels"},{"attributes":{},"id":"1037","type":"AllLabels"},{"attributes":{"coordinates":null,"data_source":{"id":"1057"},"glyph":{"id":"1058"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1060"},"nonselection_glyph":{"id":"1059"},"view":{"id":"1062"},"y_range_name":"alt"},"id":"1061","type":"GlyphRenderer"},{"attributes":{"children":[{"id":"1002"},{"id":"1004"},{"id":"1180"}]},"id":"1181","
